(window.webpackJsonp=window.webpackJsonp||[]).push([[84],{306:function(e){e.exports={data:{posts:{totalCount:74,pageInfo:{totalPages:8,currentPage:2,isFirst:!1,isLast:!1},edges:[{node:{title:"Human life is better now than it ever has been",image:"/media/images/blog/share-of-people-who-say-they-are-happy.png",path:"/blog/2017/12/20/human-life-is-better-now-than-it-ever-has-been",excerpt:"<p>A common claim made by some religious doctrines is that the world is in an awful state, and that humanity is deteriorating. In many Christian denominations this is based on so called prophecies that are claimed to have been made thousands of years ago. It is generally stated that mankind, growing distant from their deity, would just hit the fan.</p>\n",date:"2017-12-20T00:00:00.000Z",timeToRead:5}},{node:{title:"We Evolved",image:"/media/images/blog/1.jpg",path:"/blog/2017/11/23/we-evolved",excerpt:"<p>As I wrote here a long time ago, I used to be associated with a rather well known and widespread religion – The Jehovah’s Witnesses.</p>\n",date:"2017-11-23T00:00:00.000Z",timeToRead:5}},{node:{title:"Me and Mr Carl",image:"/media/images/blog/IMG_20171119_000216_281.jpg",path:"/blog/2017/11/18/me-and-mr-carl",excerpt:"<p>So, I had a fun night.</p>\n",date:"2017-11-18T00:00:00.000Z",timeToRead:2}},{node:{title:"Life is Strange",image:"/media/images/blog/hunchback.png",path:"/blog/2017/10/21/life-is-strange",excerpt:"<p>Part of the motivation behind leaving my life in the city was the lack of employment, but the main factor was that of family.</p>\n",date:"2017-10-21T00:00:00.000Z",timeToRead:2}},{node:{title:"Insane",image:null,path:"/blog/2017/10/06/insane",excerpt:"<p>Did I ever tell you what the definition of insanity is? Insanity is doing the exact... same thing... over and over again and… expecting a different outcome.</p>\n",date:"2017-10-06T00:00:00.000Z",timeToRead:2}},{node:{title:"Absolution",image:"/media/images/blog/IMG_20170910_162231.jpg",path:"/blog/2017/09/18/absolution",excerpt:"<p>Train? Bus? Nope. In the party wagon with this guy.</p>\n",date:"2017-09-18T00:00:00.000Z",timeToRead:1}},{node:{title:"Can't hold on much longer",image:"/media/images/blog/storyofmylife.gif",path:"/blog/2017/09/18/can-t-hold-on-much-longer",excerpt:"<p>This stinks.</p>\n",date:"2017-09-18T00:00:00.000Z",timeToRead:2}},{node:{title:"A Nation of Stags",image:"/media/images/blog/IMG_20170908_170102.jpg",path:"/blog/2017/09/08/a-nation-of-stags",excerpt:"<p>And here we go again.</p>\n",date:"2017-09-08T00:00:00.000Z",timeToRead:3}},{node:{title:"Life with a Chuwi (Lapbook 12.3)",image:"/media/images/blog/chuwi.jpg",path:"/blog/2017/09/03/life-with-a-chuwi-lapbook-12-3",excerpt:"<p>I’m back on the bus! But this time I am going to strive to do something productive on the journey.</p>\n",date:"2017-09-03T00:00:00.000Z",timeToRead:6}},{node:{title:"At Dawn",image:"/media/images/blog/IMG_20170823_073505.jpg",path:"/blog/2017/08/25/at-dawn",excerpt:"<p>Who knew it was this cold at 5:30 am?</p>\n",date:"2017-08-25T00:00:00.000Z",timeToRead:3}}]}}}}}]);